import React from 'react';

const Footer = () => {
    return (
        <footer>
            <nav class="navbarbg-dark">
  <div class="container-fluid">
        <span class="navbar-text text-light">
        Navbar text with an inline element
        </span>
  </div>
</nav>
        </footer>
    );
}

export default Footer;
